import logo from './logo.svg';
import './App.css';
import Clientes from "./componentes/Cliente"
import Cuentas from "./componentes/Cuenta"
import MenuPpal from "./componentes/Menu"
import MostrarClientes from "./componentes/MostrarCliente"
import CrearClientes from "./componentes/CrearCliente"
import {BrowserRouter, Route, Routes} from "react-router-dom"
function App() {
  return (
    <div className="App">
      <header className='App-header'>
        <MenuPpal/>
      </header>
      <BrowserRouter>
      <Routes>
      <Route path="/cliente" element={<Clientes />} />
      <Route path="/cuenta" element={<Cuentas />} />
      <Route path="/clientes" element={<MostrarClientes />} />
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
